import React, { useState } from 'react';
import { Box, Text, Grommet, Main, Heading, Button } from 'grommet';
import Foooter from './component/Foooter';
import Headerr from './component/Headerr';
import CardsForm from './component/CardsForm';
import TabsForm from './component/TabsForm';
import TabsForm2 from './component/TabsForm2';
import InputForm from './component/InputForm';

import { BrowserRouter, useHistory } from 'react-router-dom';



function App() {

  const theme = {
    global: {
      colors: {
        brand: '#01A982',
      },
      font: {
        family: 'Roboto',
        size: '18px',
        height: '20px',
      },
    },
  };

  let history = useHistory();


  return (
    <BrowserRouter>
    <Grommet theme={theme}>
      <Headerr />
      <Main pad="small" margin={{ left: 'large', right: 'large'}} >
        <Box>
          <Heading margin={{ left: "small",top: "small", bottom: "none"}}>Hello, Jane!</Heading>
          <Text margin="small">Welcome to the HPE Asset Management Module.</Text>
        </Box>
          <CardsForm />
      </Main>
      <Box pad="small">
        <Button primary label=" Back " size="small" onClick={() => history.goBack()} />
      </Box>
      <Foooter />
      <br />
      <br />
      <TabsForm />
      <br />
      <br />
      <TabsForm2 />

    </Grommet>
    </BrowserRouter>
  );
}

export default App;
